import React from 'react'
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { Button, CardActionArea, CardActions } from '@mui/material';
import PNG from '../../Assets/portfolio-3.png';
import './Work.css';

const Work = () => {

  const cardStyle = {
    maxWidth: 345,
    backgroundColor: 'rgb(30, 30, 30)', // Menentukan warna latar belakang
  };

  return (
    <section id='works'>
      <Card sx={cad}>
        <CardActionArea>
          <CardMedia
            component="img"
            height="290"
            image={PNG}
            alt="She"
          />
          <CardContent>
            <Typography gutterBottom variant="h5" component="div">
              Kasir
            </Typography>
            <Typography variant="body2" color="text.secondary">
              Project kasir menggunakan framework laravel.
              Mencakup CRUD.
            </Typography>
          </CardContent>
        </CardActionArea>
        <CardActions className='Button'>
          <Button size="small" color="primary">
            Tonton
          </Button>
        </CardActions>
      </Card>
    </section>
  )
}

export default Work
